&Grand \u043e\u0434\u043d\u043e\u0439 \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0443\u0434\u043e\u0431\u043d\u044b\u0445 \u043b\u043e\u043a\u0430\u0446\u0438\u0439 \u0434\u043b\u044f \u0441\u043e\u0437\u0435\u0440\u0446\u0430\u043d\u0438\u044f \u0443\u0434\u0438\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u0430\u043d\u043e\u0440\u0430\u043c\u043d\u044b\u0445 \u0432\u0438\u0434\u043e\u0432 \u043d\u0430 \u0433\u043e\u0440\u043e\u0434. \u041f\u0440\u0435\u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u0416\u041a Grand&Grand - \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0432\u043e\u0434\u043e\u043e\u0447\u0438\u0441\u0442\u043a\u0438 \u0432 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u0445, - \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u044f\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043e\u0431\u0435\u0441\u043f\u0435\u0447\u0438\u0442 \u0447\u0438\u0441\u0442\u044b\u043c, \u0441\u0432\u0435\u0436\u0438\u043c \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043c \u0438 \u0441\u043e\u0437\u0434\u0430\u0441\u0442 \u043e\u043f\u0442\u0438\u043c\u0430\u043b\u044c\u043d\u044b\u0439 \u043c\u0438\u043a\u0440\u043e\u043a\u043b\u0438\u043c\u0430\u0442 \u0432 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0435, - \u043d\u043e\u0432\u0435\u0439\u0448\u0430\u044f \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0431\u0435\u0437\u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0441 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u0432\u0438\u0434\u0435\u043e\u0430\u043d\u0430\u043b\u0438\u0442\u0438\u043a\u0438, - \u0430\u0442\u043c\u043e\u0441\u0444\u0435\u0440\u0430 \u0443\u044e\u0442\u0430 \u0438 \u0433\u0430\u0440\u043c\u043e\u043d\u0438\u0438. \u0412 \u0445\u043e\u043b\u043b\u0435 \u0436\u0438\u043b\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441\u0430 Grand&Grand \u0431\u0443\u0434\u0443\u0442 \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u0442\u044c \u0437\u0432\u0443\u043a\u0438 \u043f\u0440\u0438\u0440\u043e\u0434\u044b \u0438 \u043f\u0435\u043d\u0438\u0435 \u043f\u0442\u0438\u0446. - \u0432 \u043f\u0440\u043e\u0441\u0442\u043e\u0440\u043d\u044b\u0445 \u043f\u0430\u0440\u0430\u0434\u043d\u044b\u0445 \u0441 \u0434\u0438\u0437\u0430\u0439\u043d\u0435\u0440\u0441\u043a\u043e\u0439 \u043e\u0442\u0434\u0435\u043b\u043a\u043e\u0439 \u043f\u0440\u0435\u0434\u0443\u0441\u043c\u043e\u0442\u0440\u0435\u043d\u044b \u0443\u0434\u043e\u0431\u043d\u044b\u0435 \u0437\u043e\u043d\u044b \u0434\u043b\u044f \u0432\u0441\u0442\u0440\u0435\u0447\u0438 \u0433\u043e\u0441\u0442\u0435\u0439 \u0438 \u043e\u0442\u0434\u044b\u0445\u0430, - \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u044b \u0441 \u0442\u0435\u0440\u0440\u0430\u0441\u0430\u043c\u0438, - \u043f\u043e\u0434\u0437\u0435\u043c\u043d\u044b\u0439 \u043f\u0430\u0440\u043a\u0438\u043d\u0433, \u0432 \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043c\u043e\u0436\u043d\u043e \u0441\u043f\u0443\u0441\u0442\u0438\u0442\u044c\u0441\u044f \u0438\u0437 \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u044b \u043d\u0430 \u043b\u0438\u0444\u0442\u0435, - \u043a\u043e\u043b\u044f\u0441\u043e\u0447\u043d\u044b\u0435 \u0438 \u0432\u0435\u043b\u043e\u0441\u0438\u043f\u0435\u0434\u043d\u044b\u0435 \u043d\u0430 \u043f\u0435\u0440\u0432\u043e\u043c \u044d\u0442\u0430\u0436\u0435, - \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u0432\u0438\u0434\u0435\u043e\u043d\u0430\u0431\u043b\u044e\u0434\u0435\u043d\u0438\u044f \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u0430\u044f \u043f\u043e \u0432\u0441\u0435\u043c\u0443 \u043f\u0435\u0440\u0438\u043c\u0435\u0442\u0440\u0443 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438, \u0432 \u0445\u043e\u043b\u043b\u0430\u0445 \u0438 \u043b\u0438\u0444\u0442\u0430\u0445 \u043e\u043