\u043e\u0439 \u0434\u043e\u0441\u0442\u0443\u043f\u043d\u043e\u0441\u0442\u0438 \u0440\u0430\u0441\u043f\u0430\u043b\u043e\u0436\u0435\u043d\u044b \u0432\u043e\u0434\u043d\u044b\u0439 \u043a\u043e\u043c\u043f\u043b\u0435\u043a\u0441 \"\u043e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0439\".\u0438 \u0437\u043e\u043b\u043e\u0442\u0430\u044f \u0448\u0430\u0439\u0431\u0430 \u041a\u0440\u0430\u0441\u0438\u0432\u0430\u044f \u0443\u044e\u0442\u043d\u0430\u044f \u0441\u0432\u0435\u0442\u043b\u0430\u044f \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u0441 \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e\u0439 \u0441\u043f\u0430\u043b\u044c\u043d\u0435\u0439, \u043a\u0432\u0430\u0440\u0442\u0438\u0440\u0430 \u0440\u0430\u0441\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u0442 \u043a \u043e\u0442\u0434\u044b\u0445\u0443. \u0410\u0432\u0442\u043e\u0440\u0441\u043a\u0438\u0439 \u0434\u0438\u0437\u0430\u0439\u043d \u0438 \u0435\u0432\u0440\u043e\u0440\u0435\u043c\u043e\u043d\u0442. \u0418\u043c\u0435\u0435\u0442\u0441\u044f \u0432\u0441\u0435 \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0435, \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u0430\u044f \u043c\u0435\u0431\u0435\u043b\u044c, \u043d\u043e\u0432\u0435\u0439\u0448\u0430\u044f \u0431\u044b\u0442\u043e\u0432\u0430\u044f \u0442\u0435\u0445\u043d\u0438\u043a\u0430, \u0435\u0441\u0442\u044c \u0441\u0442\u0438\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043c\u0430\u0448\u0438\u043d\u043a\u0430-\u0430\u0432\u0442\u043e\u043c\u0430\u0442, \u0422\u0412 \u0416\u041a, \u043a\u043e\u043d\u0434\u0438\u0446\u0438\u043e\u043d\u0435\u0440, \u0445\u043e\u043b\u043e\u0434\u0438\u043b\u044c\u043d\u0438\u043a, \u0421\u0412\u0427, \u0443\u0442\u044e\u0433, \u0432\u0441\u0435\u0433\u0434\u0430 \u0447\u0438\u0441\u0442\u0430\u044f \u043f\u043e\u0441\u0442\u0435\u043b\u044c, \u0445\u0430\u043b\u0430\u0442\u044b, \u0442\u0430\u043f\u043e\u0447\u043a\u0438, \u043f\u043e\u0441\u0443\u0434\u